import React from "react";
import { Button, Link } from "react-bootstrap";

import "./styles.css";

function Main() {
  return (
    <div className="App">
      <h1>Video Game Store</h1>
      <Button
        className="my-button"
        style={{ background: "gray" }}
        as={Link}
        href="/videoGameList"
      >
        See VideoGames
      </Button>
    </div>
  );
}
export default Main;
